import { useTranslation } from 'react-i18next';

import { Button, Dialog, DialogActions, DialogContent, DialogTitle } from '@mui/material';
import { makeStyles } from '@mui/styles';

const useStyles = makeStyles({});

export default function DialogConfirm(props) {
  const { open, handleClose, handleAction } = props;
  const { t } = useTranslation('travelsPage');
  const classes = useStyles();

  return (
    <Dialog
      open={open}
      onClose={handleClose}
      aria-labelledby="alert-dialog-title"
      aria-describedby="alert-dialog-description"
    >
      <DialogTitle id="alert-dialog-title">{t('TRAVEL_DIALOG_CONFIRM_REMOVE_TRIP')}</DialogTitle>
      <DialogContent dividers>
      Esta acción eliminará por completo el viaje y no se podrá recuperar nuevamente, recuerde descargar el viaje antes de eliminarlo. ¿está seguro de realizar esta acción?
      </DialogContent>
      <DialogActions>
        <Button
          onClick={(evt) => {
            evt.stopPropagation();
            handleAction();
          }}
          autoFocus
          variant="contained"
          color="secondary"
        >
          {t('TRAVEL_DIALOG_ADD_NOTE_ACCEPT')}
        </Button>
        <Button onClick={handleClose} variant="contained" color="error">
          {t('TRAVEL_DIALOG_RUN_NEW_CANCEL')}
        </Button>
      </DialogActions>
    </Dialog>
  );
}
